import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, useLocation } from "react-router-dom";
import { NavLink, Outlet } from "react-router-dom";
import { Navigate } from "react-router-dom";
import FarmerForm from "./pages/Formerform";
import Login from "./pages/Login";
import Register from "./pages/RegistrationForm";
import ForgotUsername from "./pages/ForgotUserid";
import ForgotPassword from "./pages/ForgotPassword";
import logo1 from "./assets/leftlogo.png";
import logo2 from "./assets/rightlogo.png";
import "./App.css"



const steps = [
  { label: "üèõÔ∏è Personal Information", path: "formerdetails" },
  { label: "üìå Address", path: "address" },
  { label: "üë®‚Äçüåæ Professional Information", path: "formerdetails" },
  { label: "üå± Current Crop Information", path: "formerdetails" },
  { label: "üåæ Proposed Crop Information", path: "formerdetails" },
  { label: "üíß Irrigation Details", path: "formerdetails" },
  { label: "üîç Other Information", path: "formerdetails" },
  { label: "üìÑ Documents", path: "formerdetails" },
  { label: "üõÇ Portal Access", path: "formerdetails" },
  { label: "üöú View Farmer", path: "formerdetails" },
];
  function Layout({ children, currentStep = 0, onStepChange }) {
  return (
    <div className="infologo-container">
      <header className="infotop-bar">
        <img src={logo1} alt="Digital Agristack Logo" className="infologo-left" />
        <img src={logo2} alt="DATE Logo" className="infologo-right" />
      </header>

      <div className="infomiddle-container">
      <div className="nav-bar">
      
        {steps.map(({ label, path }, index) => (
          <NavLink
            key={index}
            to={`/${steps.path}`}
            className={({ isActive }) => (isActive ? "nav-link active" : "nav-link")}
          >
            {label}
          </NavLink>
        ))}
        
      </div>
      </div>

      <div className="content-container">{children}</div>
    </div>
  );
}


function AppContent() {
  const location = useLocation();
  const noFrameRoutes = ["/login", "/register", "/forgot-username", "/forgot-password"];

  if (noFrameRoutes.includes(location.pathname)) {
    return (
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/forgot-username" element={<ForgotUsername />} />
        <Route path="/forgot-password" element={<ForgotPassword />} />
      </Routes>
    );
  }

 
  return (
    <Routes>
      {/* Redirect root to the first step */}
      <Route path="/" element={<Navigate to={`/${steps[0].path}`} />} />

      {/* Render FarmerFormWrapper on each step */}
      {steps.map(({ path }, index) => (
        <Route
          key={path}
          path={`/${path}`}
          element={<FarmerFormWrapper currentStep={index} />}
        />
      ))}
    </Routes>
  );
}


function FarmerFormWrapper({ currentStep }) {
  const [formData, setFormData] = useState({});

  return (
    <Layout currentStep={currentStep}>
      <FarmerForm
        currentStep={currentStep}
        setCurrentStep={() => {}} // not needed now if using NavLink
        formData={formData}
        setFormData={setFormData}
      />
    </Layout>
  );
}

function App() {
  return (
    <Router>
      <AppContent />
    </Router>
  );
}

export default App;
